import React from 'react';
import { Link } from 'react-router-dom';

function NotFound() {

    return (
    <nav id="menu">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/portfolio">Portfolio</Link>
        </li>
        <li>
          <Link to="/contact">Contact me</Link>
        </li>
      </ul>
    </nav>
    );
  }
 
export default NotFound;
